Solve transport equation with finite difference method
This method discretizes space and time to simplify the computation of the solution. It is then possible to approximate the derivatives with differences between points in space or time. As reminder, the formula for derivative is the following : \[
f'(x_0) = \lim\limits_{h\rightarrow 0} \frac{f(x_0+h)-f(x_0)}{h}
\] The approximation of the derivative (that can be explain via an approximation of Taylor expansion) is:
\[
f'(x_0) \approx \frac{f(x_0+h)-f(x_0)}{h}
\] This formula is for continuous function, although we’ve said that to solve EDP we will discretizes dimensions. So we need a discret form of the derivative which is :
\[
u(x+h) =\frac{u(x)-u(x)}{}
\]
Using the Euler method for the time part \[
\partial_t u(t,x)  \approx \frac{u_j^{n+1} - u_j^{n}}{\Delta t}
\] then for the spatial part :
\[
\partial_x u(t,x) \approx \frac{u_{j+1}^n - u_{j}^n }{\Delta x}
\] Now we can substitute the term as follow : $$ \[\begin{align}
\partial_t u(t,x) + v\cdot \partial_x u(t,x) &= 0 \\

\frac{u_j^{n+1} - u_j^{n}}{\Delta t} + v\cdot \frac{u_{j+1}^n - u_{j}^n }{\Delta x}  &= 0\\

u_j^{n+1}  &= \frac{v \Delta t}{\Delta x}\cdot( u_{j+1}^n - u_{j}^n) + u_j^n

\end{align}\] $$
